import React from "react";

function home() {
  return (
    <>
      <nav>
            <span>
                <a href="#home">home</a> 
                <a href="#profile">profile</a> 
            </span>
            <div>
                <button>SignIn</button>
                <button class="btn-red">SignUp</button>
            </div>
        </nav>
    </>
  );
}

export default home();
